import React from 'react';

const DropDownList = (props) =>{
    return(
        <div className="Dropdown-list">
            {Object.keys(props.list).map((data)=>{
                return (<div key={data}>
                    {props.showCategory? <h1 className="category">{data}</h1> : null}
                    <SubList list={props.list[data]}/>
                </div>)
            })}
        </div>
    )
}

const SubList = (props) =>{
    return (
        <div>
            {props.list.map((data)=>{
                return <Row data={data}/>
            })}
        </div>
    )
}
const Row = (props) =>{
    return(
        <div className="row">
            {props.data.name}
        </div>
    )
}
export default DropDownList;
